import React from 'react';
import '../index.css';
import { createUseStyles } from 'react-jss';
import colors from '../globals/colors.js';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

import ftp from '../assets/images/ftp-icon.jpg';
import gitW from '../assets/images/github-icon-white.png';
import linked from '../assets/images/linkedn-logo.png';

const linkList = [
    {
        name: "GitHub",
        link: "https://github.com/jkovalikhaas",
        icon: gitW
    },
    {
        name: "LinkedIn",
        link: "https://www.linkedin.com/in/joseph-kovalik-haas-29a615150/",
        icon: linked
    },
    {
        name: "Fancy Tile Puzzle",
        link: "https://apps.apple.com/us/app/fancy-tile-puzzle/id1462511327",
        icon: ftp
    }
];

const useStyles = createUseStyles({
    content: {
        pading: '120px 20%'
    },
    grid: {
        width: '60%'
    },
    tile: {
        width: '30%',
        maxWidth: '30%',
        height: '30%',
        maxHeight: '30%',
        paddingTop: '10%'
    },
    tileIcon: {

    }
});

export const HomeGrid = () => {
    const styles = useStyles();

    return (
        <div className={styles.content}>
            <GridList cols={3} className={styles.grid}>
            {linkList.map((x, i) => {
                return (
                    <GridListTile key={x.icon} className={styles.tile}>
                        <a  target={"_blank"} href={x.link} style={{width: "100%"}}>
                            <img className={styles.icon} src={x.icon} height={"60%"} width={"60%"} />
                        </a>
                    </GridListTile>
                )
            })}
            </GridList>
        </div>
    )
};

export default HomeGrid;
